window.bookSummaryJSON = "<p>War Dogs Trilogyâ€”Apocalyptic Sci-Fi survival Fiction</p> <p>Three Books: Heading Home, No One Left Behind, and Amazon Warrior</p> <p>Book One: Severely wounded Staff Sergeant Jason Walker and his Military Working Dog, MMax, are being shipped home. An EMP blast causes their plane to crash. Having survived two disasters, they face the Apocalypse and the struggle to get home. Will there be anything left to return to?</p> <p>Book Two: Jason and his Military Working Dog, MMax, have to fight to stay alive while searching to find Jason's sister and brother in this post-apocalyptic world. Evil haunts them every step, while they attempt to honor their military motto, \"No One Left Behind.\"</p> <p>Book Three: Outgunned and outnumbered after the world fell into chaos, Sergeant Jason Walker and his Military Working Dog, MMax, desperately need the women around them to become warfighters. These Amazon Warriors fight and die to save their friends and loved ones in this post-apocalyptic survival story.</p>"; 
